			);

			// Font families suitable for headings, but not body text
			if( $font_option == 'headings' ) {
				$suggested_fonts = array_merge( $suggested_fonts, array(
					'Abril Fatface',
					'Anton',
					'Bitter',
					'Bree Serif',
					'Domine',
					'Fjalla One',
					'Josefin Slab',
					'Patua One',
					'Playfair Display SC',
					'Playfair Display',
					'Questrial',
					'Righteous',
					'Teko',
					'Zilla Slab',
				) );
			}

			return apply_filters('dierreweb_suggested_fonts', $suggested_fonts, $font_option);
		}
	}
}
